import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'

const Session = ({ API_URL }) => {
  const params = useParams()
  const [session, setSession] = useState({})
  const [exercisesSession, setExercisesSession] = useState([])

  useEffect(() => {
    const getSession = async () => {
      await fetch(`${API_URL}/sessions/${params.id}`)
              .then(res => res.json())
              .then(data => setSession(data))
    }

    const getExercisesSession = async () => {
      await fetch(`${API_URL}/exercisesSessions/${params.id}`)
              .then(res => res.json())
              .then(data => setExercisesSession(data))
    }

    getSession()
    getExercisesSession()
  }, [API_URL, params.id])

  return (
    <div>
      <h1>{session.name}</h1>
      <table>
        <thead>
          <tr>
            <th>Ejercicio</th>
            <th>Series</th>
            <th>Repeticiones</th>
            <th>RIR</th>
            <th>Descanso</th>
            <th>Observaciones</th>
          </tr>
        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
  )
}

export default Session
